import React from 'react';

function SuccessMessage() {
    return (
        <div>
            <h2>Thank you for your purchase!</h2>
            <p>We will send an email within 24 hours with a comfirmation and tracking info</p>
        </div>
    );
}

export default SuccessMessage;
